import React, { useState } from 'react';
import ReactMapGl from 'react-map-gl';






function Mapbox() {
    const [viewPort, setviewPort] = useState({
        latitude: 45.4211,
        longitude: -75.6903,
        width: "100vw",
        height: "100vh",
        zoom: 10,


    })



    return (
        <ReactMapGl {...viewPort} mapboxApiAccessToken="pk.eyJ1IjoibmFiYW5pdCIsImEiOiJja2E3dHN6NGEwNmpqMnJwNHFncDZtM2ZjIn0.w2izA9nhYi_uMmvRiAZzSw">
            Markers Here
        </ReactMapGl>
    )

}

export default Mapbox;
